import React from 'react';
import './RecValue.css';

const RecValue = props => {
    function renderData() {
        return props.concepts.map(item =>
            <table>
            <thead>
                <th>Ingredients</th>  
                <th>Value</th>
            </thead>
             <tbody>
            <td key={item.id}>{item.name}</td>
            <td key={item.id}>{item.value} </td>
            </tbody>
            </table>
            )
    }
        return (
            <div>{renderData()}</div>
            
        )
    }


export default RecValue;
